ck: true,  // 是否锁定裁剪框初比例\n                    center: true, // 裁剪框是否居中\n                    top: 10, // 裁剪框顶部距离\n                    left:10, // 裁剪框左部距离\n                    minHeight: 80, // 裁剪框的最小高度\n                    minWidth: 80, // 裁剪框最小宽度\n                    minImgWidth: 300, // 预览区最小宽度\n                    minImgHeight: 150, // 预览区最小高度\n                    // 裁剪实时回调,返回预览尺寸数据和图片实际尺寸数据\n                    cutting: info =&gt; this.avatarCutting(info) \n                }\n            },\n            // 上传普通文件文件没有预览，直接返回后台信息\n            optionFile:{\n                url:&#39;http://doc.udo.com/api/upload.php&#39;,\n                field:&#39;file&#39;,\n                type:&#39;file&#39;\n            }\n        }\n    },\n    methods: {\n        avatarCutting(info){\n            console.log(info)\n        }\n    }\n}\n&lt;/script&gt;\n\n\n</code></pre>\n'},function(t,e,n){var o=n(0)(n(324),null,null,null);t.exports=o.exports},function(t,e,n){"use strict";function o(t){return t&&t.__esModule?t:{default:t}}Object.defineProperty(e,"__esModule",{value:!0});var i=n(325),u=o(i),a=n(1),l=o(a),r="<doc-layout>"+u.default+"</doc-layout>";e.default={template:r,components:{docLayout:l.default},data:function(){return{}},mounted:function(){},methods:{}}},function(t,e){t.exports='<h3 id="1-">1.单独使用组件</h3>\n<pre><code class="lang-javascript">import http from &#39;@helper/http&#39;\n\n// POST\nlet data ={\n    ids:[41,42,43,44,45,51,52]\n};\nhttp.post(&#39;/api/test/&#39;, data).then( res=&gt; {\n    this.list = res.data;\n}).catch( error=&gt; {\n    console.log(error);\n});\n\n\n// GET\nlet params={\n    act:&#39;getlist&#39;\n};\nhttp.get(&#39;/api/test/&#39;, params).then( res=&gt; {\n    this.list = res.data;\n}).catch( error=&gt; {\n    console.log(error);\n});\n\n\n</code></pre>\n<h3 id="2-api-">2.API封装</h3>\n<pre><code class="lang-javascript">// api.js\nimport http from &#39;@helper/http&#39;\nexport const getTestList = params =&gt; http.get(&#39;/api/test/&#39;, para